import React, { Component } from "react";
import "./header.css";

class Header extends Component {
  state = {
    nodes: [],
  };

  render() {
    return (
      <div>
        <h1>Visual Pathfinder</h1>
        <ul className="node-selection">
          <li className="node-type">Start</li>
          <li className="node-type">End</li>
          <li className="node-type">Wall</li>
        </ul>
      </div>
    );
  }
}

export default Header;
